import logo from './logo.svg';
import './App.css';
import Login from './components/Login'
import React from 'react';
import {Route, Switch, NavLink} from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <div className="content">
        <Route path="/api/users" component={Login}/>
      </div>
    </div>
  );
}

export default App;
